        Límite de pedidos por día para la compra directa<br />
        <br />
        Aquí puedes definir cuántos artículos al día permites vender a través de googleshopping direct-buy. Sin esta indicación, tu artículo permanecerá disponible en compra directa hasta que elimines el anuncio o cambies cualquier configuración.<br />
